import React, { Fragment } from 'react';

// Images
import timer from "../../assets/timer-icon.png";
import track from "../../assets/track-icon.png";

// CSS
import "./card.css";

const Card = (props) => {
    const { event } = props

    const renderWorkoutInfo = (event) => {
       if (event.duration &&
        event.distance) {
            return (
                <Fragment>
                <img alt="timer" src={timer}/>
                <span>
                <p>
                {event.duration}
                </p>
                </span>
                </Fragment>
            )
        }
    }
    return (
        <div className="card">
            <img alt="exercise-image" src={event.thumbnail} />
            <div>
                <p>{event.name} <span><img alt="event-thumbnail" src={event.image}/></span></p>
            </div>
            <div className="workout-info">
                {renderWorkoutInfo(event)}
            </div>
        </div>
    )
};

export default Card;
